import React from "react";

import { Stack, Img, Column, Text, Button, Row } from "components";

const AdminsigninPage = () => {
  return (
    <>
     <div>
      <div style={{backgroundColor:"black",display:"flex",justifyContent:"center",hight:"200px",width:"100%"}}>
        <div>LOGO</div>
      <nav style={{display:"flex",width:"100px",height:"100%"}}>
      <ul >
        <li style={{display:"inline-block",textDecoration:"none", color:"#D62A80",background:"#802AD6"}}>Regestration</li>
        <li style={{display:"inline-block",textDecoration:"none", color:"#D62A80",background:"#802AD6"}}>Login</li>
        </ul>
      </nav>
      </div>
      

      <div></div>
      </div>
    </>
  );
};

export default AdminsigninPage;
